function topMessage(type, msg) {
	$('<div class="notifications_bar" style="display:none;">' + buildMessage(type, msg, 'top') + '</div>').prependTo('body').slideDown();
}

function popupMessage(popup, type, msg) {
	$(buildMessage(type, msg, 'popup')).prependTo('#' + popup + '_popup_alerts').slideDown();
}

function innerMainMessage(div, type, msg) {
	$(buildMessage(type, msg, 'inner_main')).prependTo('#' + div).slideDown();
}

function mainMessage(type, msg) {
	$(buildMessage(type, msg, 'main')).prependTo('#content_wrapper').slideDown();
}

function loginMessage(type, msg) {
	$(buildMessage(type, msg, 'login')).prependTo('#dialog_details #login_alerts').slideDown();
}

function loginCaptchaMessage(type, msg) {
	$(buildMessage(type, msg, 'login_captcha')).prependTo('#login_captcha_alerts').slideDown();
}

function hideAlerts(type) {
	switch(type) {
		case 'login':
			$('.alert_login').slideUp();
		break;
		case 'login_captcha':
			$('.alert_login_captcha').slideUp();
		break;
		case 'main':
			$('.alert_main').slideUp();
		break;
		case 'inner_main':
			$('.alert_inner_main').slideUp();
		break;
		case 'popup':
			$('.alert_popup').slideUp();
		break;
		default:
			$('.alert').slideUp();
		break;
	}
}

function buildMessage(type, msg, page) {
	if (type == 'error') {
		var colour = 'danger';
		var icon = 'alert_2'
		var alt = 'Error'
	} else if (type == 'info') {
		var colour = 'info';
		var icon = 'info_about'
		var alt = 'Info'
	} else {
		var colour = 'success';
		var icon = 'info_about';
		var alt = 'Success';
	}

	return '<div class="alert alert-' + colour + ' dismissible alert_' + page + '" style="margin-top: 8px;' + ((page != 'inner_main') ? 'top:0;' : '') + ((page != 'top') ? 'display:none;' : '') + '">' + msg + '</div>';
}

